import React from "react";
import { connect } from "react-redux";
import { succesRate } from "../utils/utils";
import {
  setGameStatus,
  setQuestionNumber,
  setDifficultyLevel,
  setGameScore,
} from "../actions";
const GameOver = ({
  setGameStatus,
  setDifficultyLevel,
  gameScore,
  setGameScore,
}) => {
  const restartGame = () => {
    setGameScore(0);
    setDifficultyLevel(null);
    setGameStatus("start-page");
  };
  return (
    <div className="game-page">
      <div className="game-over-page">
        <div className="game-over-title">
          <h1>Game over</h1>
        </div>
        <div className="succes-rate">
          {<h2>Succes Rate:{succesRate(gameScore, 10)}%</h2>}
        </div>

        <div>
          <button
            onClick={() => restartGame()}
            className="button-difficulty start-button"
          >
            Play Again
          </button>
        </div>
      </div>
    </div>
  );
};

const mapStateToProps = (state) => {
  return state;
};

export default connect(mapStateToProps, {
  setGameStatus,
  setQuestionNumber,
  setDifficultyLevel,
  setGameScore,
})(GameOver);
